For anyone interested, here are a couple scripts for indexing in opensearch:

First, create the index (I'm using suffixes so I can use aliases, if/when I want to instantly swap out the index without changing the code):
```bash
curl -XPUT http://127.0.0.1:9200/omega_1 -H 'content-type: application/json' -d '{
  "settings": {
    "index": {
      "number_of_shards": 128,
      "number_of_replicas": 0,
      "knn": true,
      "knn.algo_param.ef_search": 100,
      "refresh_interval": "120s"
    }
  },
  "mappings": {
    "properties": {
      "youtube_id": {
        "type": "keyword"
      },
      "indexed_at": {
        "type": "date"
      },
      "start_time": {
        "type": "integer"
      },
      "end_time": {
        "type": "integer"
      },
      "video_embed": {
        "type": "knn_vector",
        "dimension": 1024,
        "method": {
          "name": "hnsw",
          "space_type": "l2",
          "engine": "faiss",
          "parameters": {
            "ef_construction": 128,
            "m": 24
          }
        }
      }
    }
  }
}'
```

Once initial sync is done, update the index to have shorter refresh and a replica per shard (assuming you have more than one node):
```bash
curl -XPUT localhost:9200/omega_1/_settings -H 'content-type: application/json' -d '{"refresh_interval":"1s", "number_of_replicas":1}'
```

Then, once initial indexing is finished, create the alias:
```bash
curl -XPOST localhost:9200/_aliases -H 'content-type: application/json' -d '
{
  "actions": [
    {
      "add": {
        "index": "omega_1",
        "alias": "omega"
      }
    }
  ]
}'
```

Then, you can query the index with something like:
```python
async with aiohttp.ClientSession() as session:
    async with session.post(
        "http://127.0.0.1:9200/omega/_search",
        json={
            "query": {
                "knn": {
                    "video_embed": {
                        "vector": meta.video_emb,
                        "k": 1,
                    },
                },
            },
            "size": 1,
        }
    ) as resp:
        assert resp.status == 200, await resp.text()
        top_hit = ((await resp.json())["hits"]["hits"] or [None])[0]
        if not top_hit:
            bt.logging.info(f"No search results in is_unique, assuming true.")
            return True
        similarity = F.cosine_similarity(
            torch.tensor(meta.video_emb).unsqueeze(0),
            torch.tensor(top_hit["_source"]["video_embed"]).unsqueeze(0)
        ).tolist()[0]
        if similarity > THRESHOLD:
            return False
        return True
```

